import React, { Component }from "react";
import { Menu } from 'semantic-ui-react'


class  NavBar extends Component{
  render() {
    return (
      <div>
        <NavLink
          to="/"
         exact >Home</NavLink>
        <NavLink
          to="/about"
          exact>About</NavLink>
          </div>
    )
  }
}

export default NavBar;
